create table pt1.prerequis
(
    id_prerequis varchar(20) not null
        primary key,
    id_cours     varchar(20) null,
    correspCours varchar(20) null,
    constraint fk_prequis
        foreign key (correspCours) references pt1.cours (id_cours),
    constraint fk_prerequis
        foreign key (id_cours) references pt1.cours (id_cours)
);
